import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import '../components/TraineeProfile.css';

function TraineeProfile() {
  const { id } = useParams();
  const [trainee, setTrainee] = useState(null);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    fetch(`http://localhost:8000/trainees/${id}`)
      .then((res) => {
        if (!res.ok) throw new Error('Trainee not found');
        return res.json();
      })
      .then((data) => setTrainee(data))
      .catch((err) => setError(err.message));
  }, [id]);

  if (error) return (
    <div className="trainee-profile-container">
      <div className="trainee-card">
        <p style={{ color: 'red' }}>{error}</p>
        <button className="trainee-back-btn" onClick={() => navigate(-1)}>Back</button>
      </div>
    </div>
  );

  if (!trainee) return (
    <div className="trainee-profile-container">
      <div className="trainee-card">
        <p>Loading...</p>
      </div>
    </div>
  );

  return (
    <div className="trainee-profile-container">
      {/* Header bar for greeting, date, and badge */}
      <div style={{
        display: 'flex',
        justifyContent: 'flex-end',
        alignItems: 'center',
        padding: '18px 24px 0 0',
        gap: 18,
        minHeight: 48
      }}>
        <div style={{
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'flex-end',
          marginRight: 12
        }}>
          <span style={{ color: '#222', fontWeight: 500, fontSize: '1.05rem', marginBottom: 0 }}>Hi preeyanut chitkot</span>
          <span style={{ color: '#888', fontSize: '0.98rem', marginTop: -2 }}>21 August 2025</span>
        </div>
        <div
          style={{
            display: 'inline-flex',
            alignItems: 'center',
            border: '2px solid',
            borderImage: 'linear-gradient(90deg, #FF9100 0%, #FF4D8B 50%, #A855F7 100%) 1',
            borderRadius: 16,
            background: '#E0E0E0',
            padding: '0.3rem 1.1rem',
            fontWeight: 700,
            fontSize: '1.15rem',
            color: '#FF4D8B',
            gap: 8,
          }}
        >
          <img
            src={process.env.PUBLIC_URL + '/Trophy.png'}
            alt="Trophy"
            style={{ width: 22, height: 22, marginRight: 4, verticalAlign: 'middle' }}
          />
          <span
            style={{
              fontWeight: 700,
              fontSize: '1.15rem',
              background: 'linear-gradient(90deg, #FF9100 0%, #FF4D8B 50%, #A855F7 100%)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              backgroundClip: 'text',
            }}
          >
            200pts
          </span>
        </div>
        <div style={{ width: 12 }} />
      </div>
      <div className="trainee-card">
        <h2>Trainee Profile</h2>
        <div className="trainee-card-info">
          <p><strong>ID:</strong> {trainee.id}</p>
          <p><strong>Name:</strong> {trainee.name || 'No name'}</p>
          <p><strong>Points:</strong> {trainee.points}</p>
          <p><strong>Streak:</strong> {trainee.streak}</p>
        </div>
        <button className="trainee-back-btn" onClick={() => navigate(-1)}>Back</button>
      </div>
    </div>
  );
}

export default TraineeProfile;
